import React, {useState} from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0)
  return (
    <div className="App">
      <header className="App-header">
        <div>
          {count}
          <button onClick = {setCount()}>Increment</button>
        </div>
      </header>
    </div>
  );
}

export default App;
